describe("HighScores", () => {
  describe("Modal", () => {
    it("activates when the game is won.", () => {
      return true;
    });

    it("deactivates when the canel button is clicked", () => {
      return true;
    });

    it("deactivates when the save button is clicked", () => {
      return true;
    });

    it("addes a new user to the list", () => {
      return true;
    });
  });

  it("registers a new highscore", () => {
    return true;
  });

  it("sorts scores by time", () => {
    return true;
  });
});
